    auto time1 = std::chrono::high_resolution_clock::now();
    LibxcInterface libxc(xc_id, true); // xc_id now passed from the caller

    size_t num_points = rho0.size();
    std::vector<double> sigma0(num_points, 0.0), sigma1(num_points, 0.0), sigma2(num_points, 0.0);
    for (size_t i = 0; i < num_points; ++i){
            sigma0[i] = gradx_rho0[i]*gradx_rho0[i] + grady_rho0[i]*grady_rho0[i] + gradz_rho0[i]*gradz_rho0[i];
            sigma1[i]= gradx_rho0[i]*gradx_rho1[i] + grady_rho0[i]*grady_rho1[i] + gradz_rho0[i]*gradz_rho1[i];
            sigma2[i] = gradx_rho1[i]*gradx_rho1[i] + grady_rho1[i]*grady_rho1[i] + gradz_rho1[i]*gradz_rho1[i];
    }
    std::vector<double> exc = libxc.gga_exc(rho0, rho1, sigma0, sigma1, sigma2);
    std::vector<double> vrho_1(num_points), vrho_2(num_points), vsigma_1(num_points), vsigma_2(num_points), vsigma_3(num_points);
    libxc.gga_vxc(rho0, rho1, sigma0, sigma1, sigma2, vrho_1, vrho_2, vsigma_1, vsigma_2, vsigma_3);

    std::vector<double> v2rho2_1(num_points), v2rho2_2(num_points), v2rho2_3(num_points), v2rhosigma_1(num_points), v2rhosigma_2(num_points), v2rhosigma_3(num_points), v2rhosigma_4(num_points), v2rhosigma_5(num_points), v2rhosigma_6(num_points), v2sigma2_1(num_points), v2sigma2_2(num_points), v2sigma2_3(num_points), v2sigma2_4(num_points), v2sigma2_5(num_points), v2sigma2_6(num_points);
    libxc.gga_fxc(rho0, rho1, sigma0, sigma1, sigma2, v2rho2_1, v2rho2_2, v2rho2_3, v2rhosigma_1, v2rhosigma_2, v2rhosigma_3, v2rhosigma_4, v2rhosigma_5, v2rhosigma_6, v2sigma2_1, v2sigma2_2, v2sigma2_3, v2sigma2_4, v2sigma2_5, v2sigma2_6);

    std::vector<double> v3rho3_1(num_points), v3rho3_2(num_points), v3rho3_3(num_points), v3rho3_4(num_points);
    std::vector<double> v3rho2sigma_1(num_points), v3rho2sigma_2(num_points), v3rho2sigma_3(num_points),
        v3rho2sigma_4(num_points), v3rho2sigma_5(num_points), v3rho2sigma_6(num_points),
        v3rho2sigma_7(num_points), v3rho2sigma_8(num_points), v3rho2sigma_9(num_points);
    std::vector<double> v3rhosigma2_1(num_points), v3rhosigma2_2(num_points), v3rhosigma2_3(num_points),
        v3rhosigma2_4(num_points), v3rhosigma2_5(num_points), v3rhosigma2_6(num_points),
        v3rhosigma2_7(num_points), v3rhosigma2_8(num_points), v3rhosigma2_9(num_points),
        v3rhosigma2_10(num_points), v3rhosigma2_11(num_points), v3rhosigma2_12(num_points);
    std::vector<double> v3sigma3_1(num_points), v3sigma3_2(num_points), v3sigma3_3(num_points),
        v3sigma3_4(num_points), v3sigma3_5(num_points), v3sigma3_6(num_points),
        v3sigma3_7(num_points), v3sigma3_8(num_points), v3sigma3_9(num_points),
        v3sigma3_10(num_points);
    libxc.gga_kxc(
        rho0, rho1, sigma0, sigma1, sigma2,
        v3rho3_1, v3rho3_2, v3rho3_3, v3rho3_4,
        v3rho2sigma_1, v3rho2sigma_2, v3rho2sigma_3, v3rho2sigma_4, v3rho2sigma_5, v3rho2sigma_6,
        v3rho2sigma_7, v3rho2sigma_8, v3rho2sigma_9,
        v3rhosigma2_1, v3rhosigma2_2, v3rhosigma2_3, v3rhosigma2_4, v3rhosigma2_5, v3rhosigma2_6,
        v3rhosigma2_7, v3rhosigma2_8, v3rhosigma2_9, v3rhosigma2_10, v3rhosigma2_11, v3rhosigma2_12,
        v3sigma3_1, v3sigma3_2, v3sigma3_3, v3sigma3_4, v3sigma3_5, v3sigma3_6,
        v3sigma3_7, v3sigma3_8, v3sigma3_9, v3sigma3_10
    );

    std::vector<double> v4rho4_1(num_points), v4rho4_2(num_points), v4rho4_3(num_points),
        v4rho4_4(num_points), v4rho4_5(num_points);
    std::vector<double> v4rho3sigma_1(num_points), v4rho3sigma_2(num_points), v4rho3sigma_3(num_points),
        v4rho3sigma_4(num_points), v4rho3sigma_5(num_points), v4rho3sigma_6(num_points),
        v4rho3sigma_7(num_points), v4rho3sigma_8(num_points), v4rho3sigma_9(num_points),
        v4rho3sigma_10(num_points), v4rho3sigma_11(num_points), v4rho3sigma_12(num_points);
    std::vector<double> v4rho2sigma2_1(num_points), v4rho2sigma2_2(num_points),
        v4rho2sigma2_3(num_points), v4rho2sigma2_4(num_points), v4rho2sigma2_5(num_points),
        v4rho2sigma2_6(num_points), v4rho2sigma2_7(num_points), v4rho2sigma2_8(num_points),
        v4rho2sigma2_9(num_points), v4rho2sigma2_10(num_points), v4rho2sigma2_11(num_points),
        v4rho2sigma2_12(num_points), v4rho2sigma2_13(num_points), v4rho2sigma2_14(num_points),
        v4rho2sigma2_15(num_points), v4rho2sigma2_16(num_points), v4rho2sigma2_17(num_points),
        v4rho2sigma2_18(num_points);
    std::vector<double> v4rhosigma3_1(num_points), v4rhosigma3_2(num_points), v4rhosigma3_3(num_points),
        v4rhosigma3_4(num_points), v4rhosigma3_5(num_points), v4rhosigma3_6(num_points),
        v4rhosigma3_7(num_points), v4rhosigma3_8(num_points), v4rhosigma3_9(num_points),
        v4rhosigma3_10(num_points), v4rhosigma3_11(num_points), v4rhosigma3_12(num_points),
        v4rhosigma3_13(num_points), v4rhosigma3_14(num_points), v4rhosigma3_15(num_points),
        v4rhosigma3_16(num_points), v4rhosigma3_17(num_points), v4rhosigma3_18(num_points),
        v4rhosigma3_19(num_points), v4rhosigma3_20(num_points);
    std::vector<double> v4sigma4_1(num_points), v4sigma4_2(num_points), v4sigma4_3(num_points),
        v4sigma4_4(num_points), v4sigma4_5(num_points), v4sigma4_6(num_points),
        v4sigma4_7(num_points), v4sigma4_8(num_points), v4sigma4_9(num_points),
        v4sigma4_10(num_points), v4sigma4_11(num_points), v4sigma4_12(num_points),
        v4sigma4_13(num_points), v4sigma4_14(num_points), v4sigma4_15(num_points);

    libxc.gga_lxc(
        rho0, rho1, sigma0, sigma1, sigma2,
        v4rho4_1, v4rho4_2, v4rho4_3, v4rho4_4, v4rho4_5,
        v4rho3sigma_1, v4rho3sigma_2, v4rho3sigma_3, v4rho3sigma_4, v4rho3sigma_5, v4rho3sigma_6,
        v4rho3sigma_7, v4rho3sigma_8, v4rho3sigma_9, v4rho3sigma_10, v4rho3sigma_11, v4rho3sigma_12,
        v4rho2sigma2_1, v4rho2sigma2_2, v4rho2sigma2_3, v4rho2sigma2_4, v4rho2sigma2_5, v4rho2sigma2_6,
        v4rho2sigma2_7, v4rho2sigma2_8, v4rho2sigma2_9, v4rho2sigma2_10, v4rho2sigma2_11, v4rho2sigma2_12,
        v4rho2sigma2_13, v4rho2sigma2_14, v4rho2sigma2_15, v4rho2sigma2_16, v4rho2sigma2_17, v4rho2sigma2_18,
        v4rhosigma3_1, v4rhosigma3_2, v4rhosigma3_3, v4rhosigma3_4, v4rhosigma3_5, v4rhosigma3_6,
        v4rhosigma3_7, v4rhosigma3_8, v4rhosigma3_9, v4rhosigma3_10, v4rhosigma3_11, v4rhosigma3_12,
        v4rhosigma3_13, v4rhosigma3_14, v4rhosigma3_15, v4rhosigma3_16, v4rhosigma3_17, v4rhosigma3_18,
        v4rhosigma3_19, v4rhosigma3_20,
        v4sigma4_1, v4sigma4_2, v4sigma4_3, v4sigma4_4, v4sigma4_5, v4sigma4_6,
        v4sigma4_7, v4sigma4_8, v4sigma4_9, v4sigma4_10, v4sigma4_11, v4sigma4_12,
        v4sigma4_13, v4sigma4_14, v4sigma4_15
    );

    auto time2 = std::chrono::high_resolution_clock::now();
    auto libxc_duration = std::chrono::duration_cast<std::chrono::milliseconds>(time2 - time1).count();

    e.resize(num_points);
    v1.resize(num_points);
    v2.resize(num_points);
    f1.resize(num_points);
    f2.resize(num_points);
    f3.resize(num_points);

        // allocate gpu memmory
    double *d_rho0, *d_rho1, *d_gradx_rho0, *d_grady_rho0, *d_gradz_rho0, *d_gradx_rho1, *d_grady_rho1, *d_gradz_rho1;
    double *d_grad2xx_rho0, *d_grad2yy_rho0, *d_grad2zz_rho0, *d_grad2xy_rho0, *d_grad2yz_rho0, *d_grad2xz_rho0;
    double *d_grad2xx_rho1, *d_grad2yy_rho1, *d_grad2zz_rho1, *d_grad2xy_rho1, *d_grad2yz_rho1, *d_grad2xz_rho1;
    double *d_grad3xxx_rho0, *d_grad3xxy_rho0, *d_grad3xxz_rho0, *d_grad3xyy_rho0, *d_grad3xyz_rho0, *d_grad3xzz_rho0;
    double *d_grad3yyy_rho0, *d_grad3yyz_rho0, *d_grad3yzz_rho0, *d_grad3zzz_rho0;
    double *d_grad3xxx_rho1, *d_grad3xxy_rho1, *d_grad3xxz_rho1, *d_grad3xyy_rho1, *d_grad3xyz_rho1, *d_grad3xzz_rho1;
    double *d_grad3yyy_rho1, *d_grad3yyz_rho1, *d_grad3yzz_rho1, *d_grad3zzz_rho1;
    double *d_grad4xxxx_rho0, *d_grad4xxxy_rho0, *d_grad4xxxz_rho0, *d_grad4xxyy_rho0, *d_grad4xxyz_rho0, *d_grad4xxzz_rho0;
    double *d_grad4xyyy_rho0, *d_grad4xyyz_rho0, *d_grad4xyzz_rho0, *d_grad4xzzz_rho0;
    double *d_grad4yyyy_rho0, *d_grad4yyyz_rho0, *d_grad4yyzz_rho0, *d_grad4yzzz_rho0, *d_grad4zzzz_rho0;
    double *d_grad4xxxx_rho1, *d_grad4xxxy_rho1, *d_grad4xxxz_rho1, *d_grad4xxyy_rho1, *d_grad4xxyz_rho1, *d_grad4xxzz_rho1;
    double *d_grad4xyyy_rho1, *d_grad4xyyz_rho1, *d_grad4xyzz_rho1, *d_grad4xzzz_rho1;
    double *d_grad4yyyy_rho1, *d_grad4yyyz_rho1, *d_grad4yyzz_rho1, *d_grad4yzzz_rho1, *d_grad4zzzz_rho1;
    double *d_sigma0, *d_sigma1, *d_sigma2, *d_exc, *d_vrho_1, *d_vrho_2, *d_vsigma_1, *d_vsigma_2, *d_vsigma_3;
    double *d_v2rho2_1, *d_v2rho2_2, *d_v2rho2_3, *d_v2rhosigma_1, *d_v2rhosigma_2, *d_v2rhosigma_3, *d_v2rhosigma_4, *d_v2rhosigma_5, *d_v2rhosigma_6;
    double *d_v2sigma2_1, *d_v2sigma2_2, *d_v2sigma2_3, *d_v2sigma2_4, *d_v2sigma2_5, *d_v2sigma2_6;
    double *d_v3rho3_1, *d_v3rho3_2, *d_v3rho3_3, *d_v3rho3_4;
    double *d_v3rho2sigma_1, *d_v3rho2sigma_2, *d_v3rho2sigma_3, *d_v3rho2sigma_4, *d_v3rho2sigma_5, *d_v3rho2sigma_6;
    double *d_v3rho2sigma_7, *d_v3rho2sigma_8, *d_v3rho2sigma_9;
    double *d_v3rhosigma2_1, *d_v3rhosigma2_2, *d_v3rhosigma2_3, *d_v3rhosigma2_4, *d_v3rhosigma2_5, *d_v3rhosigma2_6;
    double *d_v3rhosigma2_7, *d_v3rhosigma2_8, *d_v3rhosigma2_9, *d_v3rhosigma2_10, *d_v3rhosigma2_11, *d_v3rhosigma2_12;
    double *d_v3sigma3_1, *d_v3sigma3_2, *d_v3sigma3_3, *d_v3sigma3_4, *d_v3sigma3_5, *d_v3sigma3_6;
    double *d_v3sigma3_7, *d_v3sigma3_8, *d_v3sigma3_9, *d_v3sigma3_10;
    double *d_v4rho4_1, *d_v4rho4_2, *d_v4rho4_3, *d_v4rho4_4, *d_v4rho4_5;
    double *d_v4rho3sigma_1, *d_v4rho3sigma_2, *d_v4rho3sigma_3, *d_v4rho3sigma_4, *d_v4rho3sigma_5, *d_v4rho3sigma_6;
    double *d_v4rho3sigma_7, *d_v4rho3sigma_8, *d_v4rho3sigma_9, *d_v4rho3sigma_10, *d_v4rho3sigma_11, *d_v4rho3sigma_12;
    double *d_v4rho2sigma2_1, *d_v4rho2sigma2_2, *d_v4rho2sigma2_3, *d_v4rho2sigma2_4, *d_v4rho2sigma2_5, *d_v4rho2sigma2_6;
    double *d_v4rho2sigma2_7, *d_v4rho2sigma2_8, *d_v4rho2sigma2_9, *d_v4rho2sigma2_10, *d_v4rho2sigma2_11, *d_v4rho2sigma2_12;
    double *d_v4rho2sigma2_13, *d_v4rho2sigma2_14, *d_v4rho2sigma2_15, *d_v4rho2sigma2_16, *d_v4rho2sigma2_17, *d_v4rho2sigma2_18;
    double *d_v4rhosigma3_1, *d_v4rhosigma3_2, *d_v4rhosigma3_3, *d_v4rhosigma3_4, *d_v4rhosigma3_5, *d_v4rhosigma3_6;
    double *d_v4rhosigma3_7, *d_v4rhosigma3_8, *d_v4rhosigma3_9, *d_v4rhosigma3_10, *d_v4rhosigma3_11, *d_v4rhosigma3_12;
    double *d_v4rhosigma3_13, *d_v4rhosigma3_14, *d_v4rhosigma3_15, *d_v4rhosigma3_16, *d_v4rhosigma3_17, *d_v4rhosigma3_18;
    double *d_v4rhosigma3_19, *d_v4rhosigma3_20;
    double *d_v4sigma4_1, *d_v4sigma4_2, *d_v4sigma4_3, *d_v4sigma4_4, *d_v4sigma4_5, *d_v4sigma4_6;
    double *d_v4sigma4_7, *d_v4sigma4_8, *d_v4sigma4_9, *d_v4sigma4_10, *d_v4sigma4_11, *d_v4sigma4_12;
    double *d_v4sigma4_13, *d_v4sigma4_14, *d_v4sigma4_15;
    double *d_e, *d_v1, *d_v2, *d_f1, *d_f2, *d_f3;

    cudaMalloc((void**)&d_rho0, num_points * sizeof(double));
    cudaMalloc((void**)&d_rho1, num_points * sizeof(double));
    cudaMalloc((void**)&d_gradx_rho0, num_points * sizeof(double));
