    cudaMalloc((void**)&d_grad3xxz_rho0, num_points * sizeof(double));
    cudaMalloc((void**)&d_grad3xyy_rho0, num_points * sizeof(double));
    cudaMalloc((void**)&d_grad3xyz_rho0, num_points * sizeof(double));
    cudaMalloc((void**)&d_grad3xzz_rho0, num_points * sizeof(double));
    cudaMalloc((void**)&d_grad3yyy_rho0, num_points * sizeof(double));
